import Main from "./views/Main"
import {BrowserRouter, Routes, Route} from "react-router-dom"
import './App.css';


function App() {
  return (
    <BrowserRouter>
    <fieldset>
      <legend>App.jsx</legend>
        <Routes>
          <Route path="/" element={<Main />}/>
        </Routes>
    </fieldset>
    </BrowserRouter>
  );
}

export default App;
